INSERT INTO `email_template` (`id`, `category`, `subject`, `email_body`, `status`) VALUES
(1, 'Password Sending', 'New Password', '<table align="center" cellpadding="0" cellspacing="0" style="width:680px">\n	<tbody>\n		<tr>\n			<td colspan="2" style="text-align:center"><img alt="" src="http://esolz.co.in/lab6/ptplanner/assets/admin/images/logo_nav.png" /></td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td colspan="2">Hello,</td>\n		</tr>\n		<tr>\n			<td colspan="2">Your new password to login in PT-Planner app has been provided. See below<br />\n			<br />\n			Email Id:- [EMAIL]<br />\n			Password:- [PASSWORD]<br />\n			<br />\n			Please download the app and login to your account. Ignore if you have already installed.</td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td style="text-align:right">&nbsp;</td>\n			<td style="width:170px">\n			<table cellpadding="0" cellspacing="0" style="width:100%">\n				<tbody>\n					<tr>\n						<td style="text-align:right">Sincerely Yours,</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner Team</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 'Y'),
(2, 'Forgot Password', 'Forgot Password Mail', '<table align="center" cellpadding="0" cellspacing="0" style="width:680px">\n	<tbody>\n		<tr>\n			<td colspan="2" style="text-align:center"><img alt="" src="http://esolz.co.in/lab6/ptplanner/assets/admin/images/logo_nav.png" /></td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td colspan="2">Hello [FULLNAME],</td>\n		</tr>\n		<tr>\n			<td colspan="2">Please reset your password by clicking the following link<br />\n			<br />\n			Link:- [LINK]<br />\n			<br />\n			<br />\n			<br />\n			&nbsp;</td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td style="text-align:right">&nbsp;</td>\n			<td style="width:170px">\n			<table cellpadding="0" cellspacing="0" style="width:100%">\n				<tbody>\n					<tr>\n						<td style="text-align:right">Sincerely Yours,</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner Team</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 'Y'),
(3, 'Network Invitation', 'Network Invitation Mail', '<table align="center" cellpadding="0" cellspacing="0" style="width:680px">\n	<tbody>\n		<tr>\n			<td colspan="2" style="text-align:center"><img alt="" src="http://esolz.co.in/lab6/ptplanner/assets/admin/images/logo_nav.png" /></td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td colspan="2">Hello,</td>\n		</tr>\n		<tr>\n			<td colspan="2">You are invited to join the netwok <strong>[NETWORK]</strong> by <strong>[BYUSER]</strong> in PTPlanner.com.<br />\n			<br />\n			&nbsp;</td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td style="text-align:right">\n			<p>&nbsp;</p>\n\n			<p>&nbsp;</p>\n			</td>\n			<td style="width:170px">\n			<table cellpadding="0" cellspacing="0" style="width:100%">\n				<tbody>\n					<tr>\n						<td style="text-align:right">Sincerely Yours,</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner Team</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 'Y'),
(4, 'Confirm booking', 'Booking Confirmation', '<table align="center" cellpadding="0" cellspacing="0" style="width:680px">\n	<tbody>\n		<tr>\n			<td colspan="2" style="text-align:center"><img alt="" src="http://esolz.co.in/lab6/ptplanner/assets/admin/images/logo_nav.png" /></td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td colspan="2">\n			<p>Hello,</p>\n\n			<p>Your appointment has been booked. Below are the details.</p>\n\n			<p>Trainer: [TRAINER],</p>\n\n			<p>Date: [DATE], Time: [TIME], Program: [PROGRAM]</p>\n			</td>\n		</tr>\n		<tr>\n			<td colspan="2">Please check your profile for more details<br />\n			<br />\n			&nbsp;</td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td style="text-align:right">\n			<p>&nbsp;</p>\n\n			<p>&nbsp;</p>\n			</td>\n			<td style="width:170px">\n			<table cellpadding="0" cellspacing="0" style="width:100%">\n				<tbody>\n					<tr>\n						<td style="text-align:right">Sincerely Yours,</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner Team</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 'Y'),
(5, 'New booking', 'Confirmation for new booking', '<table align="center" cellpadding="0" cellspacing="0" style="width:680px">\n	<tbody>\n		<tr>\n			<td colspan="2" style="text-align:center"><img alt="" src="http://esolz.co.in/lab6/ptplanner/assets/admin/images/logo_nav.png" /></td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td colspan="2">\n			<p>Hello,</p>\n\n			<p>Your new appointment has been booked. Below are the details.</p>\n\n			<p>Client: [CLIENT],</p>\n\n			<p>Date: [DATE], Time: [TIME], Program: [PROGRAM]</p>\n			</td>\n		</tr>\n		<tr>\n			<td colspan="2">Please check your profile for more details<br />\n			<br />\n			&nbsp;</td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td style="text-align:right">\n			<p>&nbsp;</p>\n\n			<p>&nbsp;</p>\n			</td>\n			<td style="width:170px">\n			<table cellpadding="0" cellspacing="0" style="width:100%">\n				<tbody>\n					<tr>\n						<td style="text-align:right">Sincerely Yours,</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner Team</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 'Y'),
(6, 'Cancel Booking', 'Confirmation for cancelling booking', '<table align="center" cellpadding="0" cellspacing="0" style="width:680px">\n	<tbody>\n		<tr>\n			<td colspan="2" style="text-align:center"><img alt="" src="http://esolz.co.in/lab6/ptplanner/assets/admin/images/logo_nav.png" /></td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td colspan="2">\n			<p>Hello,</p>\n\n			<p>Your &nbsp;appointment for the below details has been cancelled.</p>\n\n			<p>Trainer: [TRAINER],</p>\n\n			<p>Date: [DATE], Time: [TIME]</p>\n			</td>\n		</tr>\n		<tr>\n			<td colspan="2">Please check your profile for more details<br />\n			<br />\n			&nbsp;</td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td style="text-align:right">\n			<p>&nbsp;</p>\n\n			<p>&nbsp;</p>\n			</td>\n			<td style="width:170px">\n			<table cellpadding="0" cellspacing="0" style="width:100%">\n				<tbody>\n					<tr>\n						<td style="text-align:right">Sincerely Yours,</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner Team</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 'Y'),
(7, 'Cancel Booking For Trainer', 'Confirmation for cancelling booking', '<table align="center" cellpadding="0" cellspacing="0" style="width:680px">\n	<tbody>\n		<tr>\n			<td colspan="2" style="text-align:center"><img alt="" src="http://esolz.co.in/lab6/ptplanner/assets/admin/images/logo_nav.png" /></td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td colspan="2">\n			<p>Hello,</p>\n\n			<p>Your &nbsp;appointment for the below details has been cancelled.</p>\n\n			<p>Client: [CLIENT],</p>\n\n			<p>Date: [DATE], Time: [TIME]</p>\n			</td>\n		</tr>\n		<tr>\n			<td colspan="2">Please check your profile for more details<br />\n			<br />\n			&nbsp;</td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td style="text-align:right">\n			<p>&nbsp;</p>\n\n			<p>&nbsp;</p>\n			</td>\n			<td style="width:170px">\n			<table cellpadding="0" cellspacing="0" style="width:100%">\n				<tbody>\n					<tr>\n						<td style="text-align:right">Sincerely Yours,</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner Team</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 'Y'),
