(2244, 1032, 10114, 'Hoderulling (Greeva Sanchalana 4)', 'Sitt pÃ¥ leggene og fÃ¸ttene, med tÃ¦rne vendt mot hverandre og hÃ¦lene litt ut til siden. Sitt med lang, rett rygg, nakke og hode. \nBÃ¸y hodet frem sÃ¥ du fÃ¥r haken mot brystkassen. Herfra starter du en rullebevegelse av hodet hvor du fÃ¸rst legger hodet til den ene siden med ansiktet frem og Ã¸ret mot skulderen, deretter lÃ¸fter du haken sÃ¥ hÃ¸yt og rett opp mot taket som mulig fÃ¸r du senker hodet ned til den andre siden med Ã¸ret mot skulder, og til slutt ruller ned og frem igjen med haken mot brystkassen. Fortsett hoderulle i et jevnt, lett tempo - ikke for fort og ikke for langsomt. Etter ca. 30 sekunder stopper du og gjentar 30 sekunder den andre veien. Pass pÃ¥ Ã¥ ikke bevege skuldrene eller overkroppen. VÃ¦r helt tilstede i bevegelsen samtidig som du holder ansiktet avspent. Fri pust underveis. Sitt i ro et Ã¸yeblikk etterpÃ¥.', 13719, 2013802, 1, 'https://exorlive.com/media_10114@50.50.media', 'https://exorlive.com/video/?ex=10114'),
(2245, 1032, 10109, 'Skulderrulling 2 (Skandha Chakra 2)', 'Sitt pÃ¥ leggene og fÃ¸ttene, med tÃ¦rne vendt mot hverandre og hÃ¦lene litt ut til siden. Sitt med lang, rett rygg og med ansiktet vendt rett frem med haken litt inn. Plasser fingertuppene oppÃ¥ hver sin skulder og lÃ¸ft albuene rett ut til siden. Hold skuldrene ned fra Ã¸rene og lett trukket tilbake. Begynn nÃ¥ Ã¥ tegne smÃ¥ sirkler i luften ut til siden med albuene. La bevegelsen vÃ¦re lett og uanstrengt. VÃ¦r helt tilstede i bevegelsen samtidig som du holder ansiktet avspent. Hold hodet og nakken i ro hele tiden.\nGjÃ¸r Ã¸velsen i ca 20 sekunder den ene veien fÃ¸rst og sÃ¥  i 20 sekunder den andre veien etterpÃ¥. Fri pust underveis.', 13562, 2013898, 1, 'https://exorlive.com/media_10109@50.50.media', 'https://exorlive.com/video/?ex=10109'),
(2246, 1032, 10121, 'Flyet', 'Start med Ã¥ stÃ¥ godt i balanse pÃ¥ begge ben.\nPÃ¥ en rolig innpust: lÃ¸ft armene rett ut til siden og vend hÃ¥ndflatene frem.\nPÃ¥ en rolig utpust: len overkroppen, med armene, ned til vannrett og lÃ¸ft samtidig hÃ¸yre ben opp bak deg til vannrett. StÃ¥ pÃ¥ venstre ben med  venstre kne enten helt strukket, eller med en liten bÃ¸y. Strekk deg lang fra tÃ¥spissene pÃ¥ hÃ¸yre fot til toppen av hodet. Senk hÃ¸yre hofte sÃ¥ hoftene blir like hÃ¸ye. Bli stÃ¥ende i denne stillingen i minst 10 sekunder med fri pust.\nUt av stillingen: pÃ¥ innpust retter du overkroppen opp og senker hÃ¸yre ben ned. PÃ¥ utpust senker du armene ned langs siden av kroppen. Gjenta Ã¸velsen til den andre siden.', 13590, 2013823, 3, 'https://exorlive.com/media_10121@50.50.media', 'https://exorlive.com/video/?ex=10121'),
(2247, 1032, 10100, 'Mor og barn 2', 'Sitt pÃ¥ baken med bena strukket frem. LÃ¸ft opp hÃ¸yre ben og bÃ¸y kneet. Plasser ytterkanten av hÃ¸yre fot inn i vinkelen til venstre albue, legg hÃ¸yrearmen rundt hÃ¸yre lÃ¥r og legg, og fold hendene pÃ¥ forsiden av leggen slik at hele hÃ¸yre ben blir "lÃ¥st" fast av armene. Trekk benet godt inn mot overkroppen, rett deg godt opp i ryggen og trekk skuldrene litt bakover og nedover. Begynn nÃ¥ Ã¥ "vugge" benet lett fra side til side. Du skal kjenne at det strekker lett pÃ¥ baksiden/utsiden av hÃ¸yre sete, hofte og lÃ¥r. Fri pust med nesen. Fortsett i mellom 30 og 60 sekunder fÃ¸r du legger benet ned igjen og gjÃ¸r det samme med venstre ben.', 13540, 2013844, 3, 'https://exorlive.com/media_10100@50.50.media', 'https://exorlive.com/video/?ex=10100'),
(2248, 1032, 10113, 'BÃ¸y og strekk av nakken (Greeva Sanchalana 3)', 'Sitt pÃ¥ leggene og fÃ¸ttene, med tÃ¦rne vendt mot hverandre og hÃ¦lene litt ut til siden. Sitt med lang, rett rygg, nakke og hode. \nBÃ¸y hodet fremover og fÃ¸r haken sÃ¥ nÃ¦r brystkassen som mulig. Hold ytterstrekket et kort Ã¸yeblikk fÃ¸r du lÃ¸fter hodet opp til utgangsstillingen og videre opp slik at haken lÃ¸ftes sÃ¥ hÃ¸yt opp mot taket som mulig. Hold dette strekket litt fÃ¸r du senker hodet ned mot brystkassen igjen. Pass pÃ¥ Ã¥ ikke bevege skuldrene eller overkroppen. GjÃ¸r bevegelsen rolig og uanstrengt. VÃ¦r helt tilstede i bevegelsen samtidig som du holder ansiktet avspent.\nGjÃ¸r Ã¸velsen i ca 30 sekunder med fri pust.', 13718, 2013769, 1, 'https://exorlive.com/media_10113@50.50.media', 'https://exorlive.com/video/?ex=10113'),
(2249, 1032, 10119, 'Hugging (Kashtha Takshanasana)', 'Sitt pÃ¥ huk med litt avstand mellom fÃ¸ttene, og med knÃ¦rne godt ut til siden. Ha strake armer og foldede hender som sÃ¥vidt berÃ¸rer gulvet foran deg. La overkroppen, nakken og hodet vÃ¦re lett bÃ¸yd forover.\nPÃ¥ en rask innpust: lÃ¸ft armene raskt og sÃ¥ hÃ¸yt du kan, svai i ryggen og se oppover. Forestill deg at du hogger ved oppover. Senk armene rolig ned pÃ¥ en rolig utpust, fÃ¸r du igjen "hogger" oppover pÃ¥ en rask innpust. Gjenta 10 til 15 ganger.', 13586, 2013865, 3, 'https://exorlive.com/media_10119@50.50.media', 'https://exorlive.com/video/?ex=10119'),
(2250, 1032, 10086, 'Flyndra (Matsya Kridasana)', 'Ligg fÃ¸rst pÃ¥ magen med armene strukket frem. Legg deg deretter delvis over pÃ¥ hÃ¸yre side, samtidig som du legger flate hender oppÃ¥ hverandre, og hviler hÃ¸yre kinn oppÃ¥ hendene. BÃ¸y godt opp i venstre ben slik at venstre kne berÃ¸rer venstre albue. Venstre fotsÃ¥le skal berÃ¸re forsiden av hÃ¸yre kne. Lukk Ã¸ynene, ha fri pust med nesen og fall til ro i stillingen. Du kan ligge i stillingen i mellom 1 og 5 minutter fÃ¸r du kommer rolig ut av den og gjentar til den andre siden.', 13509, 2013790, 1, 'https://exorlive.com/media_10086@50.50.media', 'https://exorlive.com/video/?ex=10086'),
(2251, 1032, 10124, 'Rett vinkel stilling (Samakonasana)', 'Start med Ã¥ stÃ¥ godt oppreist og i balanse, med hoftebreddes avstand mellom fÃ¸ttene og med armene lÃ¸st ned langs siden av kroppen.\nPÃ¥ en rolig innpust: lÃ¸ft parallelle armer rett opp mot taket, men la hÃ¥ndleddene vÃ¦re helt passive slik at hendene henger slapt fremover.\nPÃ¥ en rolig utpust: senk overkroppen ned mot vannrett med rett rygg. Ikke gÃ¥ lenger ned enn at du kan ha rett rygg hele tiden, og armene i en forlengelse av den rette ryggen. Hendene er fortsatt slappe. Bli stÃ¥ende i stillingen med fri pust i minst 10 sekunder.\nKom ut av stillingen ved Ã¥ rette overkroppen opp og lÃ¸fte armene mot taket pÃ¥ en innpust, og senk armene ned langs siden pÃ¥ en utpust. GjÃ¸r Ã¸velsen minst 3 ganger.', 13723, 2013886, 2, 'https://exorlive.com/media_10124@50.50.media', 'https://exorlive.com/video/?ex=10124'),
(2252, 1032, 10104, 'Knytte og sprike med fingrene (Mushtika Bandhana)', 'Sitt pÃ¥ leggene og fÃ¸ttene, med tÃ¦rne vendt mot hverandre og hÃ¦lene litt ut til siden. Sitt med lang, rett rygg og med ansiktet vendt rett frem. LÃ¸ft parallelle armer rett frem foran deg til vannrett. Ha lave og lett tilbaketrukne skuldre. \nFlytt nÃ¥ all din oppmerksomhet til hendene og fingrene dine, og begynn sakte vekselsvis Ã¥ knytte og Ã¥ strekke/sprike med fingrene. NÃ¥r du knytter kan du annenhver gang ha tomlene pÃ¥ utsiden av hÃ¥nda, og annehver gang ha tomlene inni hÃ¥nda. VÃ¦r helt tilstede i bevegelsen samtidig som du holder ansiktet avspent.\nGjÃ¸r Ã¸velsen i ca 30 sekunder fÃ¸r du senker armene ned igjen. Fri pust med nesen.', 13549, 2013811, 1, 'https://exorlive.com/media_10104@50.50.media', 'https://exorlive.com/video/?ex=10104'),
(2253, 1032, 10089, 'BÃ¸y og strekk i ankler (Goolf Naman)', 'Sitt pÃ¥ baken med bena strukket frem, og stÃ¸tt med hendene i matten litt bak kroppen. Flytt all din oppmerksomhet til fÃ¸ttene og anklene, og begynn vekselsvis Ã¥ strekke og bÃ¸ye anklene fremover og bakover sÃ¥ mye du klarer. Rolige bevegelser.\nVÃ¦r nÃ¸ye pÃ¥ at du ikke rÃ¸rer pÃ¥, eller spenner unÃ¸dvendig i andre kroppsdeler. Ha rolig, fri pust. Hold pÃ¥ i ca. 1 minutt.', 13515, 2013832, 1, 'https://exorlive.com/media_10089@50.50.media', 'https://exorlive.com/video/?ex=10089'),
(2254, 1032, 10117, 'Hilsen til naturen (Namaskarasana)', 'Sitt pÃ¥ huk med litt avstand mellom fÃ¸ttene, og med knÃ¦rne godt ut til siden. Plasser albuene eller overarmene pÃ¥ innsiden av knÃ¦rne og sett hÃ¥ndflatene mot hverandre foran brystkassen (hilsestilling).\nPÃ¥ en rolig utpust: strekk helt ut i armene slik at fingertuppene berÃ¸rer matten/gulvet. La knÃ¦rne komme litt nÃ¦rmere hverandre og senk hodet ned. Rund ryggen.\nPÃ¥ en rolig innpust: bÃ¸y albuene sÃ¥ hendene kommer opp til brystkassen igjen. Bruk albuene til Ã¥ skyve knÃ¦rne godt fra hverandre. Trekk skuldrene tilbake og forsÃ¸k Ã¥ svaie i ryggen. LÃ¸ft hodet og se opp.\nFortsett Ã¥ veksle mellom de to ytterstillingene med rolige bevegelser ca. 10 ganger. Pust jevnt, rolig og forholdsvis dypt med nesen underveis.', 13581, 2013757, 3, 'https://exorlive.com/media_10117@50.50.media', 'https://exorlive.com/video/?ex=10117'),
(2255, 1032, 10093, 'Halv sommerfugl (Ardha Titali Asana)', 'Sitt pÃ¥ baken med bena strukket frem. BÃ¸y opp hÃ¸yre ben og legg utsiden av hÃ¸yre ankel opp pÃ¥ forsiden av venstre lÃ¥r og slipp hÃ¸yre kne ned i retning gulvet. Du plasserer hÃ¸yrefoten pÃ¥ venstre lÃ¥r enten i nÃ¦rheten av kneet (lettest), midt pÃ¥ lÃ¥ret, eller helt opp mot lysken (vanskeligst). Rett godt opp i ryggen. Bruk nÃ¥ Ã©n finger til Ã¥ dytte kneet litt ned og la kneet fÃ¥ "sprette" opp igjen. Gjenta dette flere ganger i et ganske raskt og lett tempo. Hele benet skal vÃ¦re avspent underveis. \nGjÃ¸r Ã¸velsen i ca. 1 minutt fÃ¸r du gjÃ¸r det samme med venstre ben.', 13523, 2013853, 2, 'https://exorlive.com/media_10093@50.50.media', 'https://exorlive.com/video/?ex=10093'),
(2256, 1032, 10090, 'Rotasjon i ankler (Goolf Chakra)', 'Sitt pÃ¥ baken med bena strukket frem, og stÃ¸tt med hendene i matten litt bak kroppen. Ha litt avstand mellom fÃ¸ttene. Flytt all din oppmerksomhet til fÃ¸ttene og anklene, og begynn Ã¥ rotere anklene rundt og rundt i grundige, rolige sirkler. Etter ca 30 sekunder skifter du retning og roterer den andre veien.\nSe om du kan la lÃ¥rene vÃ¦re mest mulig i ro, og spenn av i ansiktet og kjevene. Ha rolig, fri pust. Hold pÃ¥ i ca. 1 minutt.', 13517, 2013778, 1, 'https://exorlive.com/media_10090@50.50.media', 'https://exorlive.com/video/?ex=10090'),
(2257, 1032, 10088, 'BÃ¸y og sprik med tÃ¦r (Padanguli Naman)', 'Sitt pÃ¥ baken med bena strukket frem, og stÃ¸tt med hendene i matten litt bak kroppen. Flytt all din oppmerksomhet til tÃ¦rne, og begynn vekselsvis Ã¥ bÃ¸ye/krumme og strekke/sprike med alle tÃ¦rne. Rolige bevegelser.\nVÃ¦r nÃ¸ye pÃ¥ at du ikke rÃ¸rer pÃ¥, eller spenner andre kroppsdeler. Legg sÃ¦rlig merke til at ansiktet skal vÃ¦re avspent. Det er kun tÃ¦rne som skal rÃ¸re pÃ¥ seg. Ha rolig, fri pust. Hold pÃ¥ i ca. 1 minutt.', 13513, 2013874, 1, 'https://exorlive.com/media_10088@50.50.media', 'https://exorlive.com/video/?ex=10088');
