 class="not">Full support</li>\n	<li class="not">Free integration</li>\n</ul>\n\n<p><a class="buy" href="#wrap">Try for free</a></p>\n', '<h3>6-25 users</h3>\n\n<span>$100 <small>per month and user</small> </span>\n\n<ul class="benefits-list">\n	<li>For desktops and tablets</li>\n	<li>iPhone &amp; Android app for clients</li>\n	<li>Resources</li>\n	<li>Upgrades and updates</li>\n	<li>Full support</li>\n	<li>Free integration</li>\n</ul>\n\n<p><a class="buy" href="#wrap">Try for free</a></p>\n', '<h3>25-50 users</h3>\n\n<span>$80 <small>per month and user</small> </span>\n\n<ul class="benefits-list">\n	<li>For desktops and tablets</li>\n	<li>iPhone &amp; Android app for clients</li>\n	<li>Resources</li>\n	<li>Upgrades and updates</li>\n	<li>Full support</li>\n	<li>Free integration</li>\n</ul>\n\n<p><a class="buy" href="#wrap">Try for free</a></p>\n', '<h3>50+ users</h3>\n\n<span><a data-target="#modalContact" data-toggle="modal" href="Contact us">Contact us</a><small>for an offer</small></span>\n\n<ul class="benefits-list">\n	<li>For desktops and tablets</li>\n	<li>iPhone &amp; Android app for clients</li>\n	<li>Resources</li>\n	<li>Upgrades and updates</li>\n	<li>Full support</li>\n	<li>Free integration</li>\n</ul>\n\n<p><a class="buy" href="#wrap">Try for free</a></p>\n');
