(10, 1, 4, 'LimeRoad is a fun and exciting way to discover, share and shop. A social-commerce platform targeted at the intelligent woman of today, it has an incredible width of carefully selected merchandise, enabling customers to discover the best of lifestyle products across categories like apparel, accessories, home and non-perishable food. We are passionate about finding things that rise above the mundane; that we think will catch your eye and arrest it. Moreover, to bring these to you wherever you are and whenever you feel you have the time to indulge a little. So we created a company to bring you products you will fall in love with; to give you a chance to create your own space, to tap into those hidden talents and make your personal looks and collections; to help you share your creations with friends to get that second opinion, to inspire or be inspired; and to help you shop in a way that you will find mesmerizing. We like to think of LimeRoad as the digital-age equivalent of the 16th Century Grand Trunk Road, a highway that changed the face of trade in the Indian subcontinent.', 'Y', '2015-05-06 17:45:33'),
(11, 13, 4, 'In the today’s competitive environment, It is extremely important to improve business decision-making by using factbased decision support systems. The fact-based decision support system is called Business Intelligence (BI). It is the need of the hour, no organization can be survived without it In view of this, Educate Manager is conducting a seminar on BI concepts and its most important complex and challenging part called Extraction, Transformation and Loading i.e. SQL Server Integration Services.', 'Y', '2015-05-06 17:50:49'),
