(16, 'About Us', 'about-us', 'About Us', 'About Us', 'About Us\n', '<h2>About Us</h2>\n\n<p>Everyone working on PT-Planner are enthusiasts about training. We want to improve the working environment for personal trainers and at the same time deliver a convenient and user friendly service to their clients. We believe that personal training is beneficial for everyone in the society and that PT-Planner encourages clients to hire personal trainers more often thanks to greater results and a richer user experience.</p>\n\n<p>Mail us at info@pt-planner.se<br />\nCall us at 08 - 66 66 66.</p>\n', 'Y'),
